import React from "react";
import MatchPanel from "../../components/matchPanel";
import Match from "../../components/match";
import Text from "../../components/text";


export default function MatchContent(props) {
    return(
      <div className={"lg:px-20 py-10"}>
          {props.activeTab === "results" && (
              <MatchPanel headline="Výsledky">
                  {teamData.map((match) => (
                      <Match key={match.id} time={`${match.date} ${match.time_of_game}`} team1={match.homeTeam.name} team1Img={match.homeTeam.image}
                             team2={match.awayTeam.name} team2Img={match.awayTeam.image} score1={match.parametrs.goals_home} score2={match.parametrs.goals_away}
                             id={match.id}
                      />
                  ))}
              </MatchPanel>
          )}
          {props.activeTab === "program" && (
              <MatchPanel headline="Program zápasů">
                  {teamData.map((match) => (
                      <Match key={match.id} time={`${match.date} ${match.time_of_game}`} team1={match.homeTeam.name} team1Img={match.homeTeam.image}
                             team2={match.awayTeam.name} team2Img={match.awayTeam.image} status={"Výsledek neznámý, bude se teprve hrát"}
                             id={match.id} />
                  ))}
              </MatchPanel>
          )}
          {props.activeTab === "lineUp" && (
            <Text text={"dasdsa"}></Text>
          )}
      </div>
    );
}
